import React from 'react'
import './Note.css'
import axios from 'axios'
export default function Note(props) {
  const handleclick=async ()=>{
    axios.delete("/"+props.id)

  }
  return (
    <div className='Note'>
        <h1>{props.title}</h1>
        <p>{props.desc}</p>
        <button onClick={handleclick}>delete</button>
    </div>
  )
}
